import React, { useEffect, useState } from 'react';
import axios from 'axios';

const SOTD = () => {
  const [data, setData] = useState(null);
  const [contentLoaded, setContentLoaded] = useState(false);

  useEffect(() => {
    axios
      .get('http://localhost:5001/api/filtered_stocks')
      .then((response) => {
        console.log('Fetched Data:', response.data);
        setData(response.data);
        setContentLoaded(true);
      })
      .catch((error) => {
        console.log('ERROR:', error);
      });
  }, []);

  useEffect(() => {
    if (data) {
      console.log('State Data:', data);
    }
  }, [data]);

  if (!contentLoaded) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h2>Day-trading</h2>
      <h3>Top picks for today</h3>
      {data && data['Day Trading'] && data['Day Trading'].length > 0 ? (
        <ul>
          {data['Day Trading'].map((stock, index) => (
            <li key={index}>
              <p>Ticker: {stock.ticker}</p>
              <p>Price: ${stock.price ? stock.price.toFixed(2) : 'N/A'}</p>
              <p>Name: {stock.name}</p>
              <p>Change Percent: {stock.change_percent ? stock.change_percent.toFixed(2) : 'N/A'}%</p>
              <p>Volume: {stock.volume ? stock.volume.toLocaleString() : 'N/A'}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No data available</p>
      )}
    </div>
  );
};

export default SOTD;
